webpackJsonp([0xb3840ee2b83f],{1028:function(e,n){e.exports={data:{markdownRemark:{html:'<p>This kind of stuff is (Search Engine Optimization, or SEO) is relevant to every website, but I think that nonprofits and do-gooders can use it the most. Here\'s a chance to brush-up, as the rules change slightly every day. </p>\n<blockquote class="large">\n<p>Yaro Starak has written an in-depth review of <cite>The 8 Essential Things You REALLY Need to Know About Search Engine Optimization</cite>, a CD where Brad Fallon talks about ways of improving search engine rankings. The review is split into two parts: <a href="http://www.entrepreneurs-journey.com/331/search-engine-marketing-part-1/">The 80/20 Of Search Engine Marketing - Part 1</a>, which contains on-page SEO techniques, and <a href="http://www.entrepreneurs-journey.com/336/search-engine-marketing-part-2/">The 80/20 Of Search Engine Marketing - Part 2</a>, where off-page techniques are discussed.</p>\n</blockquote>\n<p>The point is this: </p>\n<ol>\n<li>Title Tags</li>\n<li>Keyword Density</li>\n<li>Site Structure</li>\n<li>Internal Links</li>\n<li>Links and PageRank</li>\n<li>Page Reputation</li>\n<li>Anchor Text</li>\n<li>Link Popularity</li>\n</ol>\n<p>Via: <a href="http://www.456bereastreet.com/archive/200512/8_essential_search_engine_marketing_techniques/#comments">8 essential search engine marketing techniques | 456 Berea Street</a></p>',frontmatter:{created_at:"December 20, 2005",path:"/2005/12/20/updated-tactics-for-making-your-information-findable",title:"Updated Tactics for Making Your Information Findable",tags:["seo","findability"]}}},pathContext:{}}}});
